import {Link} from 'react-router-dom';
import logo from "../images/HigherEducationLogo.png";

export default function Header2({
    heading,
    paragraph,
    linkName,
    linkUrl="#"
}){
    return(
        <div className="mb-10">
            <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">
                {heading}
            </h2>
            <div className="flex justify-center">
              <div className="w-full mr-auto ml-auto  text-center px-4 place-self-center justify-center">
                    <div className=" w-29 h-29 ">
                        <img className=" w-25 h-24 mr-auto ml-auto mt-4 mb-1" src={logo} alt=""/>
                    </div>
              </div>
            </div>
            <h1 className=" text-center text-2xml text-gray-600 mt-5">
            {paragraph} {' '}
            <Link to={linkUrl} className="font-medium text-purple-600 hover:text-purple-500">
                {linkName}
            </Link>
            </h1>
        </div>
    )
}
